// ==UserScript==
// @name         Twitter: Fix Emoji 15.0
// @version      1
// @description  Twemoji is not up-to-date with Emoji 15.0 (Unicode 15.0). This script replaces some Emoji 15.0 with working URLs on Twitter.
// @author       https://github.com/rico-vz
// @match        *://twitter.com/*
// @grant        none
// @namespace https://greasyfork.org/users/1022850
// @downloadURL https://update.greasyfork.org/scripts/466207/Twitter%3A%20Fix%20Emoji%20150.user.js
// @updateURL https://update.greasyfork.org/scripts/466207/Twitter%3A%20Fix%20Emoji%20150.meta.js
// ==/UserScript==

const emoji15 = {
    "1FAE8": "data:image/png;base64,",
    "1FA77": "data:image/png;base64,",
    "1FA75": "data:image/png;base64,",
    "1FA76": "data:image/png;base64,",
    "1FACF": "data:image/png;base64,",
    "1FACE": "data:image/png;base64,",
    "1FABF": "data:image/png;base64,",
    "1FABD": "data:image/png;base64,",
    "1FABC": "data:image/png;base64,",
    "1FABB": "data:image/png;base64,",
}

function replaceEmoji() {
  const emojis = document.querySelectorAll('img[src^="https://abs-0.twimg.com/emoji/v2/svg/"]');
  emojis.forEach(emoji => {
    const src = emoji.getAttribute('src');
    const unicode = src.replace('https://abs-0.twimg.com/emoji/v2/svg/', '').replace('.svg', '').toUpperCase();
    if (emoji15[unicode]) {
      emoji.setAttribute('src', emoji15[unicode]);
    }
  });
}


const pageObserver = new MutationObserver(replaceEmoji);
pageObserver.observe(document.body, { childList: true, subtree: true });
